import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [videos, setVideos]= useState([]);
  const [name , setName] = useState('ellie');

  useEffect(() =>{
    const requestOptions = {
      method: 'GET',
      redirect: 'follow'
    };

    fetch("https://www.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&maxResult=25&key=AIzaSyD_EZJ9_I97yVPGl5NZJU9q9e4dJxUX58g"
    , requestOptions)
      .then(response => response.json())
      .then(result => setVideos(result.items))
      .catch(error => console.log('error', error));
  },[])


  return (
    <h1>Hello :)</h1>
  );
}

export default App;
